import React, { useState } from 'react';
import Dashboard from './components/TravelDashboard';
import ResumeUpload from './components/ResumeUpload';
import FlightSearch from './components/FlightSearch';

const App: React.FC = () => {
  const [currentPage, setCurrentPage] = useState('dashboard');

  const renderPage = () => {
    switch(currentPage) {
      case 'dashboard':
        return <Dashboard />;
      case 'resume-upload':
        return <ResumeUpload />;
      case 'flight-search':
        return <FlightSearch />;
      default:
        return <Dashboard />;
    }
  };

  return (
    <div className="container">
      <header className="header">
        <h1>NaviHire</h1>
        <p>AI-Powered Talent & Travel Intelligence Platform</p>
      </header>

      <nav className="nav-menu">
        <ul>
          <li>
            <a 
              href="#" 
              className={currentPage === 'dashboard' ? 'active' : ''}
              onClick={() => setCurrentPage('dashboard')}
            >
              Dashboard
            </a>
          </li>
          <li>
            <a 
              href="#" 
              className={currentPage === 'resume-upload' ? 'active' : ''}
              onClick={() => setCurrentPage('resume-upload')}
            >
              Resume Upload
            </a>
          </li>
          <li>
            <a 
              href="#" 
              className={currentPage === 'flight-search' ? 'active' : ''}
              onClick={() => setCurrentPage('flight-search')}
            >
              ✈️ Flight Search
            </a>
          </li>
        </ul>
      </nav>

      <main>
        {renderPage()}
      </main>
    </div>
  );
};

export default App;
